import React from 'react';
import { Box, Flex, Text } from "@radix-ui/themes";
import "@radix-ui/themes/styles.css";
import BackgroundSVG from './BackgroundSVG'; // File SVG dipisahkan

function Home() {
  return (
    <div className="container-fluid position-absolute top-50 start-50 translate-middle p-5">
      <div className="row">
        <div className="col-lg-8 col-12 d-md-block d-none">
          <Text as="h1" className="display-1">
            Aplikasi Absensi
          </Text>
          <Text as="h2" className="display-5">
            Gratis .. tak berlisensi untuk kebutuhan sekolah
          </Text>
        </div>
        <div className="col-lg-4 col-12 rounded rounded-5 position-relative">
        <div style="width:400px" class="rt-reset rt-BaseCard rt-Card rt-r-size-4 rt-variant-surface"><h3 class="rt-Heading rt-r-size-6 rt-r-lt-start rt-r-mb-5">Sign in</h3><div class="rt-Box rt-r-mb-5"><label><div class="rt-Text rt-r-size-2 rt-r-weight-medium rt-r-mb-1">Email</div><div class="rt-TextFieldRoot rt-r-size-2 rt-variant-surface"><input spellcheck="false" placeholder="Enter your email address" className="rt-reset rt-TextFieldInput"/></div></label></div><div className="rt-Box rt-r-position-relative rt-r-mb-5"><div class="rt-Flex rt-r-ai-baseline rt-r-jc-space-between rt-r-mb-1"><label for="card-password-field" class="rt-Text rt-r-size-2 rt-r-weight-medium">Password</label><a data-accent-color="" href="#" class="rt-Text rt-reset rt-Link rt-r-size-2 rt-underline-auto">Forgot password?</a></div><div className="rt-TextFieldRoot rt-r-size-2 rt-variant-surface"><input spellcheck="false" id="card-password-field" placeholder="Enter your password" className="rt-reset rt-TextFieldInput"/></div></div><div class="rt-Flex rt-r-jc-end rt-r-gap-3 rt-r-mt-6">
        <button data-accent-color="" className="rt-reset rt-BaseButton rt-r-size-2 rt-variant-soft rt-Button">Create an account</button>
        <button data-accent-color="" className="rt-reset rt-BaseButton rt-r-size-2 rt-variant-solid rt-Button">Sign in</button></div></div>
        </div>
      </div>
    </div>
  );
}

export default Home;
